import React from "react";
import * as S from '../App.styles';
import 'primeicons/primeicons.css';
import { useState } from "react";
import HeaderLogin from "../components/HeaderLogin";
import FormsLogin from "../components/FormsLogin";
import FormsSignIn from "../components/FormsSignIn";

const SignIn = () => {
    return(
        
        
        <S.ContainerSignIn>
            <S.AlredySignIn>
                <h2>Já sou cadastrado!</h2>
                <h4>Para se autenticar, informe seu e-mail e senha:</h4>
                <FormsLogin/>
            </S.AlredySignIn>
            <S.FirstBuySignIn>
                <h2>Esta é minha primeira compra</h2>
                <h4>O cadastro em nossa loja é simples e rápido</h4>
                <FormsSignIn/>
            </S.FirstBuySignIn>

        </S.ContainerSignIn>
        
    )
}

export default SignIn;
